import { MenuLinkStyles } from './MenuLinkStyles';

export default function MenuLink({ product, href, ref }) {
  console.log(product);
  return (
    <MenuLinkStyles
      href={{
        pathname: '/products/[products]',
        query: { products: `${product.title}` },
      }}
    >
      <a href={product.title} ref={ref}>
        {product.title}
      </a>
    </MenuLinkStyles>
  );
}
